void make_output_recs()
{
    char g1[5000]; // gene 1
    char g2[5000]; // gene 2
    char t[5000];
    char annotation[2048];
    int i,j,fld;
    int status;
    int idx1,idx2;
    unsigned short int usi = 0x0;
    unsigned char c;
    struct gene_type space;
    struct gene_type *z1;
    struct gene_type *z2;
    unsigned char R;
    unsigned char G;
    unsigned char B;



fprintf(stderr,"here 1\n"); fflush(stderr); 
    num_out_genes = 0;
    t[0] = g1[0] = g2[0] = (char)0;
    fld=j=i=0;
    while (1)
    {
        if (i == UNCOMPRESSED_SIZE_DATAPC) break;
        c = uncompressed_datapc[i];
        if (c == '|') // "|" is our end of string.
        {
            if (fld == 0) { strcpy(g1,t); t[0] = (unsigned char)0; j=0; }
            else if (fld == 1) { strcpy(g2,t); t[0] = (unsigned char)0; j=0; }
            fld++;
            if (fld == 2)
            {
                // wrong: usi = ( uncompressed_datapc[i+1] << 8) | uncompressed_datapc[i+2];
                // right: vvv
                usi = ( uncompressed_datapc[i+1] ) | ( uncompressed_datapc[i+2] << 8);

                space.hugo = &g1[0];
                z1 = bsearch(&space,in_genes,num_in_genes,sizeof(struct gene_type),cmp_hugo); 
                if (z1)
                {
// fprintf(stderr,"checking for [%s] %s num_in_genes=%d\n",g1,g2,num_in_genes); 
                     space.hugo = &g2[0];
                     z2 = bsearch(&space,in_genes,num_in_genes,sizeof(struct gene_type),cmp_hugo); 
                     if (z2)
                     {
                           // ding ding!  good.  found gene1, gene2 interaction.
// fprintf(stderr,"adding %s %s !\n",g1,g2);
                         idx1 = idx2 = -1;
                         status = add_genes(z1,z2,&idx1,&idx2);
                         if (status == 0)  
                         { // 0= success (added genes to output structure,
                           //  which gets converted to vis.network javascript objects  (later).

// fprintf(stderr,"adding %s %s %d %d\n",g1,g2,idx1,idx2);
                             annotation[0] = (char)0;
                             R = G = B = 0xff;
                             get_color_and_annotation(g1,g2,usi,annotation,&R,&G,&B);
                             add_edge(idx1,idx2,annotation,R,G,B);
                         }
                     }
                }
                i+=3; // why 3? skip 1 "|" field terminator AND the 2 bytes of "interaction_type" , so 3 bytes
                fld = 0;
                g1[0] = g2[0] = (char)0;
                continue;
            }
        }
        else
        {
            t[j++] = c;
            t[j] = (char)0;
        }
        i++;
    }
fprintf(stderr,"end of make_output_recs(), num_out_genes=%d \n",num_out_genes); fflush(stderr); 
    return;
}

