void free_global_data(void)
{
    int i;
    for (i=0 ; i<num_in_genes ; i++)
    {
       if (in_genes[i].hugo) free((void *)in_genes[i].hugo);
       in_genes[i].hugo = (char *)0;
       if (in_genes[i].color) free((void *)in_genes[i].color);
       in_genes[i].color = (char *)0;
    }
    num_in_genes = 0;

    for (i=0 ; i<num_out_genes ; i++)
    {
       if (out_genes[i].hugo) free((void *)out_genes[i].hugo);
       if (out_genes[i].color) free((void *)out_genes[i].color);
       if (out_genes[i].desc) free((void *)out_genes[i].desc);
       out_genes[i].hugo = out_genes[i].color = out_genes[i].desc =(char *)0;
    }
    num_out_genes = 0;

    for (i=0 ; i<num_edges ; i++)
    {
       if (edges[i].annotation) free(edges[i].annotation);
       edges[i].annotation = (char *)0;
       edges[i].from = edges[i].to = 0;
    }
    num_edges = 0;
}

